import React from "react";
import ReactDOM from "react-dom";
import Bootstrap from "bootstrap/dist/css/bootstrap.css";
import * as ReactBootstrap from "react-bootstrap";

class Kompo extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <ReactBootstrap.Button bsStyle="danger" bsStyle="large">
        Nappi
      </ReactBootstrap.Button>
    );
  }
}

ReactDOM.render(<Kompo />, document.getElementById("root"));
